有効成分を効率的に蒸散できる大型サイズ。<BR>黒色ネットが光を吸収し、温度が蒸散することで蒸散量がアップ。<BR>アミ戸に貼っておくだけで、２００日間イヤな虫の侵入を防止。 メーカー：
フマキラー<br />
